import { Component } from '@angular/core';
import { NavController } from 'ionic-angular';
import { Camera, CameraOptions } from '@ionic-native/camera';
import { MobileAccessibility } from '@ionic-native/mobile-accessibility';
import { HomePage2 } from './../home2/home2';
import { TextToSpeech } from '@ionic-native/text-to-speech';

@Component({
  selector: 'page-home',
  templateUrl: 'home.html'
})
export class HomePage {

	image: string = null;
	FastBase64;
	texto: string = "1. Empieza por tomar una foto al objeto, para escuchar el sonido resultante de sus colores. Activa la cámara tocando el botón que está en el centro de la pantalla.";

	nn: string = "data:image/jpeg;base64,";
 	n2: string ="";
  constructor(private mobileAccessibility: MobileAccessibility, public navCtrl: NavController, private camera: Camera, private tts: TextToSpeech) {

  }


  //Cuando se carga completamente la vista
  ionViewDidLoad() {
  	setTimeout( () => {
     // somecode
	}, 2000);
    console.log("I'm alive!");
    this.tts.speak({
      text: this.texto,
      rate: 12 / 10,
      locale: "es-ES"
    })
   .then(() => console.log('Success'))
   .catch((reason: any) => console.log(reason));
  }

  //Metodo que reproduce el parrafo de la vista
  reproducir(){
  	
  	setTimeout( () => {
     // somecode
	}, 2000);
    console.log("I'm alive!");
    this.tts.speak({
      text: this.texto,
      rate: 12 / 10,
      locale: "es-ES"
    })
   .then(() => console.log('Success'))
   .catch((reason: any) => console.log(reason));
  }

  //Metodo para obtener imagen de camara
  getPicture(){
  	


  	this.tts.stop();
    this.tts.speak({
      text: "Camara activada.",
      rate: 12 / 10,
      locale: "es-ES"
    })
   .then(() => {const  options: CameraOptions = {
      destinationType: this.camera.DestinationType.DATA_URL,
      targetWidth: 1000,
      targetHeight: 1000,
      quality: 100
    }
    this.camera.getPicture( options )
     .then(imageData => {
      this.image = 'data:image/jpeg;base64,' + imageData;
      this.navCtrl.push(HomePage2, {
      data: this.image,
      date: imageData
	 });
    })
    .catch(error =>{
      console.error( error );
    });
  })
   .catch((reason: any) => console.log(reason));

  }

  /*
  this.navCtrl.push(HomePage2, {
      data: this.nn,
      date: this.n2
  });}*/
}
